;; **
;;; ## Example dataflow
;;; 
;;; Let us consider a typical dataflow that may occur in a machine learning experiment. Note that this is almost the bare minimum -- we do not even do cross-validation here.
;;; 
;;; We take the raw data corresponding to a certain year; clean it; split it to training and testing; extract the `x` parts (the features) and the `y` parts (the response); compute some statistics on the training data; normalize both training and testing data using these statistics; train a model on the normalized training data; compute its predictions for the normalized test data; compute the error of prediction; and extract some performance measures from the error.
;;; 
;;; We do not implement all this here, but rather just write a typical expression one may use to achive that, assuming that all necessary data-processing functions are given.
;; **

;; @@
(def dataflow
  '(let [raw-data (select-data year)
         cleaned-data (clean-data raw-data outlier-threshold)
      	 train-and-test-data (train-test-split cleaned-data train-test-ratio randomness-seed)
      	 train-data (:train train-and-test-data)
      	 train-data-x (extract-columns train-data feature-columns)
      	 train-data-y (extract-column train-data response-column)
      	 test-data (:test train-and-test-data)
      	 test-data-x (extract-columns test-data feature-columns)
       	 test-data-y (extract-column test-data response-column)
       	 statistics (summarize train-data-x)
       	 normalized-train-data-x (normalize train-data-x statistics)
       	 normalized-test-data-x (normalize test-data-x statistics)
       	 model (train normalized-train-data-x train-data-y model-type model-params)
       	 predictions (predict normalized-test-data-x model)
       	 errors (- predictions test-data-y)
       	 performance (measure-performance errors measure-type)
  permormance]))
