;; **
;;; ## The graph of dependencies 
;;; 
;;; Let us analyse this expression, to figure out the dependencies across data objects along the process:
;; **

;; @@
(def dependencies
  (->> dataflow
     second
     (partition 2)
     (map (fn [[output [function & inputs]]]
            [output function inputs]
               {:function function
                :output output
                :inputs (vec inputs)}))))
